import * as Yup from 'yup';
import * as moment from "moment";

moment.defaultFormat = "DD/MM/YYYY";
let invalidDate = new Date('');

export default Yup.date().transform((value) => {
  return value.isValid() ? value.moment() : invalidDate;
});
